<pre><code>{ 
  &quot;codf&quot;: &quot;002&quot;,
  &quot;nome&quot;: &quot;Debora&quot;,
  &quot;cognome&quot;: &quot;Palermo&quot;,
  &quot;datanascita&quot;: &quot;1953-01-17&quot;
  &quot;age&quot;: 41
}
</code></pre>
<p>What I tried so far is in the linked Mongo playground below: <a href="https://mongoplayground.net/p/8KF9M7f3PIT" rel="nofollow noreferrer">https://mongoplayground.net/p/8KF9M7f3PIT</a></p>
<p>Basically, I successfully calculated the total number of people with a certain age, but I'm failing to calculate the total amount of people in the collection to actually calculate the percentage, that because if I use the <code>$count</code> operator, it aggregates the documents and I don't want that.</p>
<p>The output should look like this:</p>
<pre><code>{ 
  &quot;age&quot;: 41,
  &quot;percentage_with_age&quot;: &lt;actual_percentage&gt;
}
</code></pre>

