axios GET request not working in MERN application<p>So, I am attempting a simple, single-page application on the MERN stack that takes notes - a note title and a note content and displays them on the same root route; the data is supposed to also be saved on the backend for later retrieval. At this time, there is no authentication. My backend seems to be working perfectly, but when I connect the front end React application to the backend MongoDB database, my GET request (using axios instance) fails.</p>
<p>My backend renders on localhost:5000, no problem.</p>
<p>But on localhost:3000, I'm seeing this error in App.jsx:</p>
<pre><code>Error: Request failed with status code 404
   at createError (createError.js:16)
   at settle (settle.js:17)
   at XMLHttpRequest.handleLoad (xhr.js:62)
</code></pre>
<p>Here's what I have going on:</p>
<p><strong>BACKEND</strong></p>
<pre><code>// server.js

import express from 'express';
import cors from 'cors';

import notes from './api/notes.route.js';

const app = express();

app.use(cors());
app.use(express.json());
app.use(express.urlencoded({ extended: true }));

app.use('/api/v1/notes', notes);
app.use('*', (req, res) =&gt; res.status(404).json({ error: 'not found' }));

export default app;



// notes.route.js

import express from 'express';
import NotesController from './notes.controller.js';

const router = express.Router();

router
  .route('/')
  .get(NotesController.apiGetNotes)
  .post(NotesController.apiPostNote)
  .put(NotesController.apiUpdateNote)
  .delete(NotesController.apiDeleteNote);

export default router;



// notes.controller.js

import NotesDAO from '../dao/notesDAO.js';

class NotesController {
  static apiGetNotes = async (req, res, next) =&gt; {
    const notesPerPage = req.query.notesPerPage
      ? parseInt(req.query.notesPerPage)
      : 20;

    const page = req.query.page ? parseInt(req.query.page) : 0;

    const { notesList, totalNumNotes } = await NotesDAO.getNotes({
      page,
      notesPerPage
    });

    let response = {
      notesList,
      page,
      notesPerPage,
      totalNumNotes
    };

    res.json(response);
  };

export default NotesController;



// notesDAO.js

import mongodb from 'mongodb';

const ObjectID = mongodb.ObjectId;

let notes;

class NotesDAO {
  // call this on db connection:
  static injectDB = async conn =&gt; {
    if (notes) return;

    try {
      notes = await conn.db(process.env.NOTESDB_NS).collection('notes');
    } catch (e) {
      console.error(`unable to establish collection handle in notesDAO: ${e}`);
    }
  };

  static getNotes = async ({ page = 0, notesPerPage = 20 } = {}) =&gt; {
    let query;
    let cursor;

    try {
      cursor = await notes.find(query);
    } catch (e) {
      console.error(`unable to issue find command, ${e}`);
      return { notesList: [], totalNumNotes: 0 };
    }

    const displayCursor = cursor.limit(notesPerPage).skip(notesPerPage * page);

    try {
      const notesList = await displayCursor.toArray();
      const totalNumNotes = await notes.countDocuments(query);

      return { notesList, totalNumNotes };
    } catch (e) {
      console.error(
        `unable to convert cursor to array or problem counting documents, ${e}`
      );
      return { notesList: [], totalNumNotes: 0 };
    }
  };
}

export default NotesDAO;

</code></pre>
<p><strong>FRONTEND</strong></p>
<pre><code>// index.js

import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom';

import App from './App';

ReactDOM.render(
  &lt;React.StrictMode&gt;
    &lt;BrowserRouter&gt;
      &lt;Route path=&quot;/&quot; component={App} /&gt;
    &lt;/BrowserRouter&gt;
  &lt;/React.StrictMode&gt;,
  document.getElementById('root')
);



// App.jsx

import { useState, useEffect } from 'react';
import NoteDataService from './services/note.js';
import Header from './Header';
import Footer from './Footer';
import CreateArea from './CreateArea';
import Notes from './Notes';

const App = () =&gt; {
  const [notes, setNotes] = useState([]);

  useEffect(() =&gt; {
    retrieveNotes();
  }, []);

  const retrieveNotes = async () =&gt; {
    await NoteDataService.getAll()
      .then(response =&gt; {
        console.log(response.data);
        setNotes(response.data.notes);
      })
      .catch(e =&gt; console.log(e));
  };

  return (
    &lt;&gt;
      &lt;Header /&gt;
      &lt;CreateArea clicked={addNote} /&gt;
      &lt;Notes notes={notes} clicked={deleteNote} /&gt;
      &lt;Footer /&gt;
    &lt;/&gt;
  );
};

export default App;



// http-common.js

import axios from 'axios';

export default axios.create({
  baseURL: 'http://localhost:5000/api/vi/notes',
  headers: {
    'Content-type': 'application/json'
  }
});



// note.js

import http from '../http-common.js';

class NoteDataService {

  getAll() {
    return http.get('/');
  }
}

export default new NoteDataService();


</code></pre>

