Display the conditionnal size of an array with the others fields of a mongodb document<p>I have a collection of <code>fridges</code> and I would like to have some fields from each fridge matching a condition plus the 'conditionnal size' of the items in this fridge.</p>
<p>This is an example of my DB :</p>
<pre><code>db={
  &quot;fridges&quot;: [
    {
      _id: 1,
      items: [
        {
          itemId: 1,
          name:&quot;beer&quot;
        },
        {
          itemId: 2,
          name: &quot;chicken&quot;
        }
      ],
      brand:&quot;Bosch&quot;,
      size:195,
      cooler:true,
      color:&quot;grey&quot;
    },

    {
      _id: 2,
      items: [
        {
          itemId: 1,
          name:&quot;beer&quot;
        },
        {
          itemId: 2,
          name: &quot;chicken&quot;
        },
        {
          itemId: 3,
          name: &quot;lettuce&quot;
        }
      ],
      brand:&quot;Electrolux&quot;,
      size:200,
      cooler:true,
      color:&quot;white&quot;
    },
  ]
}
</code></pre>
<p>I want to get <code>fridges</code> with these mutuals conditions ('and' condition):</p>
<ul>
<li><code>brand</code> is <code>$in [&quot;Bosch&quot;,&quot;Samsung&quot;]</code></li>
<li><code>color</code> is <code>$in [&quot;grey&quot;,&quot;white&quot;]</code></li>
</ul>
<p>In addition :
The number of items with a name <code>$in [&quot;beer&quot;,&quot;lettuce&quot;]</code></p>
<p>And finally :
Removing some fields like the <code>size</code> and <code>items</code> of the result.</p>
<p>In our example, the excepted output would be :</p>
<pre><code>{
  _id:1
  itemsNumber:1,
  brand:&quot;Bosch&quot;,
  cooler:true,
  color:&quot;grey&quot;
}
</code></pre>
<p>Explanations :
We removed the field <code>items</code> and <code>size</code>, <code>itemsNumber</code> counts the number of beers and lettuce from <code>items</code> array. And we only keep the first fridge its brand is Bosch and it's grey.</p>
<p>This what I have so far :</p>
<pre><code>db.fridges.aggregate([
  {
    &quot;$match&quot;: {
      $and: [
        {
          &quot;brand&quot;: {
            $in: [
              &quot;Bosch&quot;,
              &quot;Samsung&quot;
            ]
          }
        },
        {
          &quot;color&quot;: {
            $in: [
              &quot;grey&quot;,
              &quot;white&quot;
            ]
          }
        }
      ]
    }
  },
  {
    &quot;$project&quot;: {
      &quot;itemsNumber&quot;: {
        $size: &quot;$items&quot; // This is not good
      },
      brand: 1,
      cooler: 1,
      color: 1
    }
  }
])
</code></pre>
<p>Which returns me :</p>
<pre><code>[
  {
    &quot;_id&quot;: 1,
    &quot;brand&quot;: &quot;Bosch&quot;,
    &quot;color&quot;: &quot;grey&quot;,
    &quot;cooler&quot;: true,
    &quot;itemsNumber&quot;: 2
  }
]
</code></pre>
<p>Counting the items matching with either <code>beer</code> or <code>lettuce</code> is my main problem.
<a href="https://mongoplayground.net/p/4xsb24ekz3W" rel="nofollow noreferrer">This</a> is an executable example.</p>
<p>Thanks in advance !</p>

