<pre><code>{
    _id: 1,
    answer: 42,
    parent: {
        lock: true
    }
}
</code></pre>
<p>After running</p>
<pre><code>updateOne({_id: 1}, {$unset: {'parent.lock': &quot;&quot;}});
</code></pre>
<p>The document becomes:</p>
<pre><code>{
    _id: 1,
    answer: 42,
    parent: {}
}
</code></pre>
<p>Is there a way to have the 'parent' field also be removed <strong>only if the result of the update comment is an empty object</strong> other than making a second call?</p>
<p>In other words, I want the original doc to become:</p>
<pre><code>{
    _id: 1,
    answer: 42
}
</code></pre>
<p>However, if the embedded document of the parent field also had other fields (was originally):</p>
<pre><code>{
    _id: 1,
    answer: 42,
    parent: {
        lock: true,
        child: 'other'
    }
}
</code></pre>
<p>Then the result of the update command would be:</p>
<pre><code>{
    _id: 1,
    answer: 42,
    parent: {
        child: 'other'
    }
}
</code></pre>

